import { useState } from "react";
import axios from "axios";
import React, { useEffect, useRef } from 'react';
import './App.css';
let tvScriptLoadingPromise;

const FetchName = () =>
    {
        return <h1>hellow</h1> 
    var x=1
    var y=[]
    const [name,Setname]=useState()
    const [lo,setlogo]=useState()
    const [exc,setexchange]=useState()
    const [url,seturl]=useState()
    const [phn,setphone]=useState()
    const [insdustry,setindusrty]=useState() 
    const [cp,currentp]=useState()

    var f=''

    function fetch(e)
    {
        f=e.target.value
    }
    function FetchSearch()
    {
        axios
                .get(`https://finnhub.io/api/v1/stock/profile2?symbol=${f}&token=cjmeg19r01qmdd9puljgcjmeg19r01qmdd9pulk0`)
        .then((response) =>
        {
               const {name,logo,weburl,exchange,phone,finnhubIndustry}= response.data
                 Setname(name)
                 setlogo(logo)
                 setexchange(exchange)
                 setindusrty(finnhubIndustry)
                 setphone(phone)
                 seturl(weburl)
            
        })
        axios
        .get(`https://finnhub.io/api/v1/quote?symbol=${f}&token=cjmeg19r01qmdd9puljgcjmeg19r01qmdd9pulk0`)
.then((response) =>
{
       const {c}= response.data
             currentp("price: $ "+ c)
    
})








const onLoadScriptRef = useRef();

useEffect(
  () => {
    onLoadScriptRef.current = createWidget;

    if (!tvScriptLoadingPromise) {
      tvScriptLoadingPromise = new Promise((resolve) => {
        const script = document.createElement('script');
        script.id = 'tradingview-widget-loading-script';
        script.src = 'https://s3.tradingview.com/tv.js';
        script.type = 'text/javascript';
        script.onload = resolve;

        document.head.appendChild(script);
      });
    }

    tvScriptLoadingPromise.then(() => onLoadScriptRef.current && onLoadScriptRef.current());

    return () => onLoadScriptRef.current = null;

    function createWidget() {
      if (document.getElementById('tradingview_ff1c9') && 'TradingView' in window) {
        new window.TradingView.widget({
          autosize: true,
          symbol: "NASDAQ:AAPL",
          interval: "D",
          timezone: "Etc/UTC",
          theme: "dark",
          style: "1",
          locale: "en",
          enable_publishing: false,
          allow_symbol_change: true,
          container_id: "tradingview_ff1c9"
        });
      }
    }
  },
  []
);
  
}

    return(<>
    
    <input type="text" onChange={fetch}/>
    <button onClick={FetchSearch}>Generate</button>
     <h1>{name}</h1>
     <img src={lo}/>
     <h2>{cp}</h2>
     <h2>{exc}</h2>
     <h2>{insdustry}</h2>
     <h2>{phn}</h2>
     <a href={url}>{name}</a>

     <div className='tradingview-widget-container' >
      <div id='tradingview_ff1c9'  />
      <div className="tradingview-widget-copyright" >
        <a href="https://www.tradingview.com/" rel="noopener nofollow" target="_blank"><span className="blue-text">Track all markets on TradingView</span></a>
      </div>
    </div>
    
    </>)
}
  

export default FetchName
